INSERT INTO `sys_recruit` VALUES ('60', null, '长城开发老厂', null, null, null, null, null, null, null, null, null, null, '为计算机、通信和其他电子设备制造业', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:46:46', '', null, null, null, '是', '斜塘，唯亭，跨塘，青剑湖，胜浦', '包吃包住', '免费工作餐，住宿免费，水电均摊', '是', '是', '是', '否', '是', '3月份280一天，4月份230一天，5月份210一天，6月份210一天\n后长期做210一天，一周后可以预支1000，部门任选，每月8号结薪同工同酬.当月月底补差价，做不满4个月同工同酬发，企业加班多，每月正常28天班，月综合工资7500-9000元', null, '', '1500');
INSERT INTO `sys_recruit` VALUES ('61', null, '霞飞诺眼镜', null, null, null, null, null, null, null, null, null, null, null, null, '1', '1', '1', '1', null, null, '0', '260', '2021-03-19 10:46:46', '', null, null, null, '是', '车坊、斜塘、唯亭、跨塘、胜浦、凌港、车坊 、甪直', '包住', '有住宿', '否', '否', '是', '否', '否', '加班基数 2350  全勤奖50绩效+岗位津贴0-800  夜班津贴2元/小时  满三个月有1500的留任奖金  转正后加班基数为2600   综合到手薪资：5500-6500/月，白班6：30~18：00，夜班18：30~6：00（工作时间根据生产需求安排）。\n有厂车 ，有住宿。   ', null, '', '500');
INSERT INTO `sys_recruit` VALUES ('62', null, '乔治菲歇尔 ', null, null, null, null, null, null, null, null, null, null, '做地暖盘管', null, '1', '1', '1', '1', null, null, '0', '261', '2021-03-19 10:46:46', '', null, null, null, '是', '跨塘，胜浦，斜塘，华东电器城', '', '', '否', '否', '是', '否', '否', '综合薪资6500左右\n底薪2050，加班基数2400，加班按照法定。\n另：全勤奖300，绩效300，安全奖100，岗位补贴300，满一个月增加100工龄奖\n每年有旅游，年终奖，缴纳社保\n至少做到4月底', null, '', '500');
INSERT INTO `sys_recruit` VALUES ('63', null, '圣万提', null, null, null, null, null, null, null, null, null, null, '机械装备', null, '1', '1', '1', '1', null, null, '0', '262', '2021-03-19 10:46:46', '', null, null, null, '是', '跨塘、青剑湖、唯亭、斜塘、车坊、湖东、湖西、吴中等', '包吃', '餐补18元/天', '否', '否', '是', '否', '否', '看懂机械图纸，熟悉使用测量工具，有机械装配经验者优先。综合薪资：7000-10000元之间，底薪（加班基数）：3000--3500元(面试的时候看经验决定加班基数）\n绩效：平均1000元/月，不偷懒不犯错都可以拿到1000元/月\n加班时间：白班算3小时\n夜班补助：48元（30元夜班补助+18元餐补）\n社保：缴纳园区社保（前6个月按最低基数缴纳）\n不限加班时间，两班倒，2周倒班一次。', null, '', '1500');
INSERT INTO `sys_recruit` VALUES ('64', null, '益而益', null, null, null, null, null, null, null, null, null, null, '作业员、QC，电源插座、漏电保护器等产品专业生产加工', null, '1', '1', '1', '1', null, null, '0', '263', '2021-03-19 10:46:46', '', null, null, null, '是', '凌港，重村，斜塘，车坊，板桥（夜班无厂车车）', '包吃包住', '宿舍免费', '否', '否', '是', '否', '否', '长白班、两班倒，底薪2120、全勤120、绩效0-1000、岗位津贴0-300、综合5000–7000，不穿无尘衣，坐着上班，', null, '', '1200');
INSERT INTO `sys_recruit` VALUES ('65', null, '瑞萨半导体', null, null, null, null, null, null, null, null, null, null, '看显微镜，智能型芯片解决方案的半导体生产厂商', null, '1', '1', '1', '1', null, null, '0', '264', '2021-03-19 10:46:46', '', null, null, null, '是', '', '包吃', '', '否', '否', '是', '否', '是', '底薪2720（加班基数2720），全勤150，绩效0-200，白班津贴10元/天，夜班津贴20元/天；上四休二，两班倒，要穿无尘衣，包吃，', null, '', '1500');
INSERT INTO `sys_recruit` VALUES ('66', null, '星崎电机', null, null, null, null, null, null, null, null, null, null, '开发食品贮藏、保鲜的新技术并生产冷藏设备、制冰设备、加热烹饪器、饮料供应机、洗碗机及其零部件', null, '1', '1', '1', '1', null, null, '0', '266', '2021-03-19 10:46:46', '', null, null, null, '', '', '包吃包住', '', '否', '否', '否', '否', '否', '临时工10 小时，白班25一小时，夜班26一小时，上一个夜班在补12元，目前基本都是常白班。', null, '', '800');
INSERT INTO `sys_recruit` VALUES ('67', null, '奥英光电', null, null, null, null, null, null, null, null, null, null, '研发、加工、组装液晶电视、液晶显示器、平板电脑等', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:46:46', '', null, null, null, '', '', '', '', '是', '否', '否', '否', '否', '检测部门:3月份300/天，4月份280/天，5月以后长期200/天或长期工\n辅助部门: 3月份300/天，4月份220/天，5月以后长期200/天或长期工', null, '', '800');
INSERT INTO `sys_recruit` VALUES ('68', null, '麦克维尔', null, null, null, null, null, null, null, null, null, null, '生产中央空调可以参观车间', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:46:46', '', null, null, null, '是', '唯亭，胜浦，斜塘，甪直，跨塘', '', '', '否', '否', '是', '否', '否', '试用期底薪2750，两个月后底薪2900，厂车不到的有车补120/月，周末加班补贴10/天，夜班补贴15/天，平时加班算3.5小时，津贴300元左右，节日福利200及礼品，每年四月份涨底薪，综合5500~7000元，', null, '', '1000');
INSERT INTO `sys_recruit` VALUES ('69', null, '大金空调', null, null, null, null, null, null, null, null, null, null, null, null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:46:46', '', null, null, null, '是', '胜浦，斜塘，重村，南山维拉，清江，甪直，马庄，印象欧洲，正义，临港，板桥。唯亭，跨塘，青剑湖', '包吃包住', '报道安排住宿', '否', '否', '是', '否', '否', '月工资：5800-6800左右，一年十四薪，福利待遇好，每年4月份涨底薪，上班时间 8:30-8:45 ，算4个小时加班,厂车到苏州各地。底薪2740（加班基数），6个月后底薪3150（加班基数），全勤100 安全奖50 达成奖100 倒班补贴15/天 ，餐补260，加班稳定', null, '', '1000');
INSERT INTO `sys_recruit` VALUES ('70', null, '康泰无尘', null, null, null, null, null, null, null, null, null, null, '生产应用于制药、半导体、汽车等行业的无尘擦拭用品及原料布(仅限于原料布的清洗、烘干）', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:46:46', '', null, null, null, '否', '', '', '', '否', '否', '是', '否', '否', '长期小时工，实发工资，无差价。\n白班20元每小时（240一天）\n中班21元每小时（252一天）\n夜班22元每小时（264一天）\n每个班都按12小时计算，另外每月加600左右绩效奖和全勤50元，综合工资7000左右。正常离职提前三天不扣工资！长期小时工工.可以转正，转正后底薪2750.交住房公积金。', null, '', '800');
INSERT INTO `sys_recruit` VALUES ('71', null, '长城开发老厂', null, null, null, null, null, null, null, null, null, null, '为计算机、通信和其他电子设备制造业', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:47:53', '', null, null, null, '是', '斜塘，唯亭，跨塘，青剑湖，胜浦', '包吃包住', '免费工作餐，住宿免费，水电均摊', '是', '是', '是', '否', '是', '3月份280一天，4月份230一天，5月份210一天，6月份210一天\n后长期做210一天，一周后可以预支1000，部门任选，每月8号结薪同工同酬.当月月底补差价，做不满4个月同工同酬发，企业加班多，每月正常28天班，月综合工资7500-9000元', null, '', '1500');
INSERT INTO `sys_recruit` VALUES ('72', null, '霞飞诺眼镜', null, null, null, null, null, null, null, null, null, null, null, null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:47:53', '', null, null, null, '是', '车坊、斜塘、唯亭、跨塘、胜浦、凌港、车坊 、甪直', '包住', '有住宿', '否', '否', '是', '否', '否', '加班基数 2350  全勤奖50绩效+岗位津贴0-800  夜班津贴2元/小时  满三个月有1500的留任奖金  转正后加班基数为2600   综合到手薪资：5500-6500/月，白班6：30~18：00，夜班18：30~6：00（工作时间根据生产需求安排）。\n有厂车 ，有住宿。   ', null, '', '500');
INSERT INTO `sys_recruit` VALUES ('73', null, '乔治菲歇尔 ', null, null, null, null, null, null, null, null, null, null, '做地暖盘管', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:47:53', '', null, null, null, '是', '跨塘，胜浦，斜塘，华东电器城', '', '', '否', '否', '是', '否', '否', '综合薪资6500左右\n底薪2050，加班基数2400，加班按照法定。\n另：全勤奖300，绩效300，安全奖100，岗位补贴300，满一个月增加100工龄奖\n每年有旅游，年终奖，缴纳社保\n至少做到4月底', null, '', '500');
