INSERT INTO `sys_recruit` VALUES ('91', null, '大金空调', null, null, null, null, null, null, null, null, null, null, null, null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:48:56', '', null, null, null, '是', '胜浦，斜塘，重村，南山维拉，清江，甪直，马庄，印象欧洲，正义，临港，板桥。唯亭，跨塘，青剑湖', '包吃包住', '报道安排住宿', '否', '否', '是', '否', '否', '月工资：5800-6800左右，一年十四薪，福利待遇好，每年4月份涨底薪，上班时间 8:30-8:45 ，算4个小时加班,厂车到苏州各地。底薪2740（加班基数），6个月后底薪3150（加班基数），全勤100 安全奖50 达成奖100 倒班补贴15/天 ，餐补260，加班稳定', null, '', '1000');
INSERT INTO `sys_recruit` VALUES ('92', null, '康泰无尘', null, null, null, null, null, null, null, null, null, null, '生产应用于制药、半导体、汽车等行业的无尘擦拭用品及原料布(仅限于原料布的清洗、烘干）', null, '1', '1', '1', '1', null, null, '0', 'heping01', '2021-03-19 10:48:56', '', null, null, null, '否', '', '', '', '否', '否', '是', '否', '否', '长期小时工，实发工资，无差价。\n白班20元每小时（240一天）\n中班21元每小时（252一天）\n夜班22元每小时（264一天）\n每个班都按12小时计算，另外每月加600左右绩效奖和全勤50元，综合工资7000左右。正常离职提前三天不扣工资！长期小时工工.可以转正，转正后底薪2750.交住房公积金。', null, '', '800');
